import React from 'react'
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
  return (
    <div className='text-center'>
        <p className='text-center'>아래버튼으로 진료 등록을 진행하세요</p>
        <button className='btn fo'>진료등록</button>
    </div>
  )
}

export default Home
